import React, {Component} from "react";

export class About extends Component {
  constructor() {
    super();
    this.state = {
      people: ["Justin", "Robert", "Tom Brady"],
    };
  }

  render() {
    return (
      <div>
        <h1>About</h1>
        {this.state.people.map((person) => (
          <p>{person}</p>
        ))}
      </div>
    );
  }
}
